CREATE PROCEDURE [dbo].[load_link_LED__Treiber] as

TRUNCATE TABLE link.LED__Treiber;



WITH src as
(

SELECT 

		h.Gehaeuse_SK
	,	h.Form
	,	h.Farbe
	,	h.Leuchtentyp
	,	h.Typ
	,	h.Verstellbarkeit
	,	s.Moegliche_Konverter
	,	s.Moegliche_Leuchtmittel
	,	s.Artikelnummer

FROM hub.M1_Gehaeuse h
INNER JOIN sat.M1_Gehaeuse_Stammdaten s ON h.Gehaeuse_SK = s.Gehaeuse_SK
),

src2 as(

SELECT 
	
		h1.Leuchte_SK
	,	h1.Farbkanal
	,	h1.Lichtfarbe
	,	h1.Leistung
	,	s1.Artikelnummer
	,	s1.Moegliche_Konverter



FROM hub.M1_Leuchte h1 
INNER JOIN sat.M1_Leuchte_Stammdaten s1 ON h1.Leuchte_SK = s1.Leuchte_SK

),
src3 as
(
SELECT


s.* 
FROM hub.M1_Treiber h
INNER JOIN sat.M1_Treiber_Stammdaten s ON h.Treiber_SK = s.Treiber_SK

)

INSERT INTO link.M1_Leuchte__Treiber (Leuchte_SK, Treiber_SK)
SELECT distinct
	
		
		src2.Leuchte_SK
  , src3.Treiber_SK

FROM src
INNER JOIN src2 ON src.Moegliche_Leuchtmittel LIKE '%'+ src2.Artikelnummer + '%'
INNER JOIN src3 ON src.Moegliche_Konverter LIKE '%'+ src3.Artikelnummer + '%'


where 1=1
GO
